import img1 from "./Images/cake.jfif";
import img2 from "./Images/chips.jpg";
import img3 from "./Images/juice.jpg";
import img4 from "./Images/popcorn.png";
import img5 from "./Images/strawberry.jfif";
import img6 from "./Images/yoghurt.jfif";

const mydiv = [
  { id: "1", title: "This is the 1st Image", src: img1 },
  { id: "2", title: "This is the 2nd Image", src: img2 },
  { id: "3", title: "This is the 3rd Image", src: img3 },
  { id: "4", title: "This is the 4rth Image", src: img4 },
  { id: "5", title: "This is the 5th Image", src: img5 },
  { id: "6", title: "This is the 6th Image", src: img6 },
];

export default mydiv;
